@sencho `index.txt` must be an explicit list of files. You can use a regular expression in a script that generates `index.txt`.

With the process I've described above in points `1.` and `2.` there's no need to run a previous analysis: each analysis will be completely separate.

But, notice that step `1.`, the capture, must run on all the files, every time.

@jeremydubreil  Thanks for looking into it. I just downloaded the openssh source code again and ran infer.  And I got the same error again.

The commands I used are,



I was wondering if I invoked Infer correctly here.

>  Infer uses its own version of clang. I may be wrong but the version installed on the system should not matter. @jvillard: is this correct ?

@jeremydubreil correct.

> If I increase the --iterations flag, Infer will probably get more precise, right?

It will spend more time on procedures before giving up. That often translates into more precision but your mileage may vary.

@xennygrimmato size of chains of function calls do not matter thanks to the way the interprocedural analysis is implemented: a caller only knows to read the spec of the callees, it doesn't need to go and look at their code.

>  Infer uses its own version of clang. I may be wrong but the version installed on the system should not matter. @jvillard: is this correct ?

@jeremydubreil correct.

> If I increase the --iterations flag, Infer will probably get more precise, right?

It will spend more time on procedures before giving up. That often translates into more precision but your mileage may vary.

@xennygrimmato size of chains of function calls do not matter thanks to the way the interprocedural analysis is implemented: a caller only knows to read the spec of the callees, it doesn't need to go and look at their code.

@chaws does upgrading opam solve the issue for you? If so, could you please change your PR to bump the required version of opam up?

As it stands, opam 1.2.0 is untested on our end so even if we include your fix it's possible we end up breaking it again in the future. 1.2.2 is available on many major systems. Debian stable still uses 1.2.0 but it's easy to manually upgrade.

Let me know if that makes sense to you, we could also find a way to test opam 1.2.0 in our Travis CI for instance.

