@guafei the way Infer works is by following what the build system of your project does, so to prevent Infer from analysing c++ files, you have to modify your build system to not compile them.

Or you can try this untested trick:



This will hardcode the c++ compiler to be, eg, /usr/bin/clang++ instead of just clang++. This will prevent Infer from replacing clang++ with its own clang and make this step essentially invisible to Infer.

