The following code is identified as STRONG_DELEGATE_WARNING:
@property (readwrite, nonatomic, strong) NSMutableDictionary *mutableTaskDelegatesKeyedByTaskIdentifier;

It should not have been.

Here is one additional requirements that could improve the checker:
- in order to identify a property as delegate, besides containing "delegate" in the name also require the usage of a protocol in the type.
- In this case it it also obvious, that a class from the Foundation framework does not play the role of a delegate - but since those classes can always implement a protocol via a class extension, this might not be a good thing to check.

