I found this from the following documentation.
http://fbinfer.com/docs/infer-bug-types.html#RETAIN_CYCLE

The Retain Cycle is described as follows.

@class Child;
@interface Parent : NSObject {
    Child *child;
}
@end
@interface Child : NSObject {
    __weak Parent *parent;
}
@end

But I think, this is valid if "Child" is a subclass of "Parent". Here both Child and Parent are inherited from NSObject class and hence are independent. 
I think the documentation should be corrected as follows.

@class Child;
@interface Parent : NSObject {
    Child *child;
}
@end
@interface Child : Parent {
    __weak Parent *parent;
}
@end

